import React from 'react'
import TableData from './TableData'

function TableRow({ userContact }) {
    const getData = () => {
        for (const contactItem in userContact) {
            if (
                contactItem !== 'userId' &&
                contactItem !== 'contactId' &&
                contactItem !== 'profile'
            ) {
                return (
                    <td>
                        {console.log(userContact[contactItem])}
                        <TableData></TableData>
                    </td>
                )
            }
        }
    }

    return <tr>{getData()}</tr>
}
export default TableRow
